import React from "react";
import { Button } from "react-bootstrap";
import Navbar from "./Navbar";
import Wave from "react-wavify";

function Home() {
  return (
    <div id="Home">
      <Wave
        className="wave"
        fill="#140a42"
        paused={false}
        options={{
          height: 20,
          amplitude: 45,
          speed: 0.1,
          points: 5
        }}
      />
      <div className="intro">
        <h1>
          Welcome to <em className="highlight">Courier Pals</em>.
        </h1>
        <h3>
           <em className="highlight">Recieve</em> goods from everywhere with little hassle.
        </h3>
        <Button variant="outline-light" id="action-btn">
          Get Started!
        </Button>
      </div>
    </div>
  );
}

export default Home;
